                "for_search": "Huawei Nova 11i <p>Кольца Double Star Orbit, встроенные в мерцающую матовую текстуру изысканного корпуса, помогают создать культовый образ, а покрытие, защищающее от пота и отпечатков пальцев, гарантирует фантастические тактильные ощущения.</p><p>HUAWEI nova 11i может похвастаться 6,8-дюймовым дисплеем HUAWEI FullView и ультратонкими рамками толщиной 1 мм, благодаря которым соотношение экрана к корпусу достигает невероятных 94,9 %. 7 Яркая четкость экрана позволяет смотреть фильмы и играть в игры в великолепном разрешении HD. Экран также интеллектуально регулирует ваши впечатления от просмотра в зависимости от внешней яркости, поэтому независимо от того, находитесь ли вы на улице в солнечный день или под ярким городским освещением ночью, вы всегда можете наслаждаться превосходным изображением.</p><p>Частота обновления экрана 90 Гц 8 обеспечивает плавность действий на экране, а частота дискретизации сенсорного экрана 270 Гц 9 позволяет прокручивать веб-сайты и видео с небольшой задержкой и намного быстрее выполнять действия во время игр.</p><p>Благодаря максимальной громкости динамика, увеличенной до 88 дБ 6 , музыка и фильмы звучат лучше, чем когда-либо прежде. Благодаря технологии Histen 8.1, HUAWEI nova 11i обладает профессионально настроенным звуком, обеспечивающим насыщенные басы, четкие средние частоты, улучшенный динамический диапазон и невероятные эффекты объемного звучания, которые обеспечивают невероятно аутентичные и изысканные впечатления от прослушивания.</p><p>HUAWEI nova 11i обеспечивает сверхбыструю зарядку с помощью технологии HUAWEI SuperCharge Turbo 1 мощностью 40 Вт . Когда включен режим Turbo, телефон можно зарядить до 60% за 30 минут. 10 В сочетании с аккумулятором сверхбольшой емкости 5000 мАч, усиленным технологией интеллектуального управления питанием и 22-уровневой интеллектуальной защитой от зарядки, HUAWEI nova 11i может сопровождать вас от рассвета до заката с запасом энергии.</p><p>48-мегапиксельная камера высокого разрешения 4 в сочетании с 2-мегапиксельной камерой глубины позволяет запечатлеть окружающий мир с невероятной детализацией. Благодаря использованию алгоритма домена RAW камеры могут идентифицировать ключевые элементы сцены и точно фиксировать детали как при ярком освещении, так и в темных тенях, чтобы ваши фотографии всегда были потрясающе яркими.</p><p>Получите общую картину, сохранив при этом мелкие нюансы, которые имеют значение. Сохраняйте незабываемые моменты со всеми их прекрасными текстурами, яркими цветами и изысканными деталями при свете и темноте, чтобы создавать снимки жизни во всей ее красе.</p><p>Записывайте захватывающие дух ночные городские пейзажи с неоновым освещением и заманчивым контрастом между светом и тьмой.</p><p>Боке Портрет</p><p>Сделайте акцент на портретном снимке, смягчив фон.</p><p>Снимок ИИ</p><p>Запишите особые мимолетные моменты в одно мгновение, чтобы вы могли пережить их снова, когда захотите.</p><p>Пусть ваши истинные цвета сияют, а все красоты вокруг звучат в гармонии, независимо от дня и ночи.</p><p>Включите режим Double View для записи видео с использованием передней и задней камер одновременно, чтобы взглянуть на вещи по-новому. Покажите свою реакцию на интересную сцену или запишите забавный разговор с другом — возможности безграничны.При записи видео вы можете свободно переключаться между передней и задней камерами, а в финальном видео будут плавные переходы между ними. Постредактирование не требуется.</p><p>Благодаря 128 ГБ памяти вы можете легко хранить 160 эпизодов популярных телевизионных драм, 10 000 треков в высоком разрешении и более 70 фильмов в формате Ultra HD. 11</p>",
